insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (35, 24001, 0, 15, 2, 0, '', '', 0, 1, 30000);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (36, 91002, 0, 1, 8, 0, '', '', 0, 100, 40000);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (37, 91002, 1, 1, 8, 107501, 'ぺコリーヌ', '今日は記念日、お祝いですね！\\n焼肉、お寿司、ピザ、ケーキ～☆\\nあなたとパーティできるなんて、\\n幸せです～♪', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (38, 91002, 1, 2, 8, 107601, 'コッコロ', 'この記念日を迎えられたのは、\\n主さまの器量の賜物\\nさすがは主さまでございます\\nえらい、えらい♪', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (39, 91002, 1, 3, 8, 107801, 'キャル', 'あんたもけっこうやるじゃない！\\nちょっとは…割と…け、けっこう\\n見直しちゃったわ\\n褒めてあげる♪', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (40, 91002, 1, 4, 8, 107701, 'スズメ', 'あなたと私にとって、\\n今日は特別な日\\nあなたの支えがあるから、\\n私は頑張れるんです！', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (41, 91002, 1, 5, 8, 107901, 'タマキ', '今日はキミにとっての\\n特別な記念日だにゃ\\nキミの活躍にはいつも\\n猫ながら感謝してるにゃ～♪', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (42, 91002, 2, 6, 8, 107501, 'ぺコリーヌ', 'う～かき氷食べ過ぎて、\\n身体が冷えちゃいました…\\nあなたの体温で温めてください！\\nギューーッ♪', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (43, 91002, 2, 7, 8, 107601, 'コッコロ', '夏は危険がいっぱいと申します…\\nですが、わたくしが主さまを\\nしっかりとお守りいたしますよ', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (44, 91002, 2, 8, 8, 107801, 'キャル', 'ん～なんであんたと、ひと夏を\\n過ごすことになったのかな…\\n結構楽しいからいいけど！\\nさ、まだまだ遊ぶわよ！', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (45, 91002, 2, 9, 8, 107701, 'スズメ', 'あなたと過ごすはじめての夏…\\nいまからドキドキが止まりません\\n楽しくて素敵な思い出が、\\nまた一つ増えるんですね♪', 0, 150, 40001);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (46, 91002, 2, 10, 8, 107901, 'タマキ', '夏は一番の稼ぎ時にゃのに、\\n今年はキミと過ごしたいって\\n思ってるにゃ楽しい思い出\\n増やしてくれるかにゃ？', 0, 150, 40001);
