insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (321, 24001, 1, 1, 2, 125801, 'リリ', 'もうすぐ、みなさまに\\nお会いできるのですね。\\n胸が高鳴ってしまいます……\\n', 0, 1, 40011);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (322, 24001, 1, 2, 2, 126001, 'クリア', '初めまして、クリアです♪\\nみなさんと一緒に冒険するの\\nとっても楽しみにしてます', 0, 1, 40011);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (323, 24001, 1, 3, 2, 126101, 'プレシア', 'んーと。\\nこれ、あげる。\\nはい', 0, 1, 40011);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (324, 24001, 2, 4, 2, 125801, 'リリ', 'あらためまして……\\n【アルターメイデン】の\\nギルドマスター、リリと申します', 0, 1, 40011);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (325, 24001, 2, 5, 2, 126001, 'クリア', 'こんにちは、お兄さん♪\\n【アルターメイデン】の\\nクリアです', 0, 1, 40011);
insert into v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79 values (326, 24001, 2, 6, 2, 126101, 'プレシア', 'お兄。\\nきてくれて、うれしい', 0, 1, 40011);
